import React from 'react'
import Timeline from './Timeline.js'
import styled from 'styled-components';

const Style = styled.div`
	margin-left: 300px;

`;

function Marvel(props) {
	return (
		<Style>
		<Timeline>
			<h1>heya</h1>
		</Timeline>
		</Style>
	)
}

export default Marvel;
